INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_173',2,13,18,2,2,123,'Case Competition in Marketing (seminar)','This is not a case competition course per se. Instead, under the auspices of l"Association des Agences de Communication Créative (A2C), every year two Quebec inter-university competitions are organized and conducted. The Relève Communication was initiated in 1992 and the Relève Marketing in 1999. JMSB has entered teams of six students in both of these competitions since their inception. For both, participating university teams are given a day-long briefing in January by a company, not-for-profit organization or government agency and one or more of its communications agencies. The brief concludes with a mandate for which teams must create a complete communications or marketing plan for the client with a due date in late April. Their recommended plans are presented to the clients in their boardrooms or in their agency"s pitch rooms. The judging panels include senior executives from the client (often its CEO), from the client"s communications agencies and from A2C members. Throughout the academic term during which the competitions occur, students have the opportunity to apply the theories that they have learned so far in their BComm program to situations which are as close to "real life" as possible in an academic setting.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_174',2,13,18,2,2,124,'Consumer Behaviour','Students obtain EL through Team Project in which each team adopts a client to solve its CB problem and pitches findings to other students assuming they are the client.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_175',2,13,18,2,2,125,'E-Marketing','(1) Term project: A real life marketing activity where students are required to (a) write up a marketing plan for digital strategy and (b) implement this marketing plan in real life by creating a website and an associated digital marketing campaign; (2) Two cases: Both individual examinations are cases based on real life marketing activities by firms, where students are asked to audit and analysis online content and provide strategic recommendations.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_176',2,13,18,2,2,126,'Marketing Channels','Case analysis (students analyze the real marketing context and make their decisions in channel based on their reasoning); Group projects (students identify the real companies in the industries and make their recommendations on marketing channels following their analysis); Group presentations (students present a specific topic in marketing channels with theories and real examples, and present their group projects).','');
