INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_179',2,13,18,1,1,95,'JMMA Fest','Recruitment for Embassy + Networking Opportunity. The students are engaged intellectually by networking with JMMA"s executive team while posing questions about recruitment opportunities at JMMA. ','https://www.jmma.ca/');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_180',2,13,18,1,1,95,'CMS Industry Spotlight','Panel event with creative and innovative agencies ready to answer questions from students. The learner is curious to learn more about creative and innovative industries. They are able to talk with different representatives from companies being exposed to a real-world context. ','https://www.jmma.ca/');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_181',2,13,18,1,1,95,'After Marketing','A conference that gives insights into the different types of career paths that students can pursue in marketing. This events groups industry professionals from different industries to talk with JMSB students. The conference includes workshops, a panel, as well as a networking cocktail. Students are able to enhance their networking skills by integrating different networking tactics learned in class. The learned is are able to pose specific questions after investigating their career of choice. Through workshops, they are able to put in practice what they have researched beforehand in a real-world context. ','https://www.jmma.ca/');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_182',2,13,18,1,1,95,'Creative Marketing Conference','Bringing in marketing professionals, speakers, a panel discussion, interactive workshops, and a networking & recruitment cocktail, the Creative Marketing Conference is a day-long event that is all about the future of marketing in different industries. The student is able to attend different workshops where they are able to experiment with marketing in different industries. The learner is able to construct meaningful connections with marketing professionals and pose questions related to different industries. ','https://www.jmma.ca/');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_183',2,13,18,1,1,95,'Networking and Keeping Connections Workshop','This workshop will enhance the students" ability to network with business professionals through different activities created by JMMA. The learner is able to practice different networking techniques in a real-world context. The student will integrate the tips learned during the workshop to role-play with other learners. ','https://www.jmma.ca/');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('JMSB_184',2,13,18,1,1,95,'Graphic Design Workshop','This workshop will be ideal for students that would like to strengthen their Photoshop capabilities, whether they are beginners or advanced users. The learner is engaged posing questions and following the actions explained by the JMMA member. Through this workshop, the student will be able to develop new skills that will be useful in a professional setting. ','https://www.jmma.ca/');
