INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1000',4,29,45,2,2,619,'African Popular Culture','This course explores the varied terrain of African popular culture in the 19th and 20th centuries. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1001',4,29,45,2,2,620,'History Through Visual Media and Material Culture','This course explores the relationship between the public and the past by examining issues in the production, distribution, and reception of history via these new and changing technologies.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1002',4,29,45,2,2,621,'The Politics of the Past','This course examines the uses of history and the role of the historian in the political arena, focusing on cases in which the past has underwritten social movements or mediated public controversies.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1003',4,29,45,2,2,622,'Selected Topics in Public History','Specific topics for this course, and relevant prerequisites, are stated in the Undergraduate Class Schedule.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1004',4,29,45,2,2,623,'Urban History Laboratory','Students conduct original archival and/or oral history research on a selected aspect of Montreal’s history and then go public with their research in creative and engaging ways.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1005',4,29,45,2,2,624,'History and Sound','This course examines sound as a historical subject and a medium for understanding the past. The course may include training in the production of radio documentaries, urban sound walks, and audio podcasts.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1006',4,29,45,2,2,625,'Methodology and History','This course examines the variety of sources, methods, and modes of analysis used in the research and writing of history. It addresses both theoretical and practical aspects of method.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1007',4,29,45,2,2,626,'Advanced Topics in Public History','Advanced seminar in a selected topic in public history. In addition to weekly discussions of relevant readings, the emphasis is on encouraging students to conduct historical investigation on their own, under a professor’s guidance. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1008',4,29,45,2,2,627,'Public History Internship','This internship in public history is designed to allow students to test and hone their skills in a non‑academic situation. ','');
