INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1012',4,30,46,2,2,630,'Feminist Economics','Practical, hands-on exercises','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1013',4,30,46,2,2,630,'Introduction to Historical Perspectives in Women’s Studies','This course provides an introduction to theories and writing that affect the lives of women. Through the writing of feminist authors, students examine, from mainly the 20th century, the development of feminist theories and debate. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1014',4,30,46,2,2,630,'Introduction to Contemporary Concerns in Women’s Studies','This course explores a range of current issues and debates within feminism. Using interdisciplinary feminist theories that consider how systems of power such as patriarchy, capitalism, racism, and heterosexism constitute one another, it examines particular local and global topics of interest/concern which may include health, education, work, violence against women, globalization, militarism, media and cultural representations, families, and feminist activism.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1015',4,30,46,2,2,630,'Health Issues: Feminist Perspectives','This course presents feminist, intersectional, postcolonialist, poststructuralist and queer examinations of a variety of women’s health issues. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1016',4,31,47,2,2,631,'Honours Seminar','With the permission of the Department, a student may arrange a tutorial program with a faculty member.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1017',4,31,47,2,2,632,'The Creative Process','This course introduces students to some options for developing their own process of literary creation, from the ENGLISH development of an idea through to the writing and editing of works of prose fiction, poetry, and/or drama.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1018',4,31,47,3,3,633,'Literary Pedagogies','Special Topics in English Literature','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1019',4,32,48,2,2,634,'Deductive Logic','This course presents the modern symbolic systems of sentential and predicate logic. Students transcribe English sentences into a logical form, analyze the concepts of logical truth, consistency, and validity, as well as learn to construct derivations in each system.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1020',4,32,48,2,2,635,'Introduction to the Philosophy of Science','This course provides an introduction to the main problems in the philosophy of science. These include the structure of scientific theories, various models of scientific method and explanation, and the existence of unobservables.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1021',4,32,48,2,2,636,'Introduction to Ethics','In this course, students are introduced to some representative approaches to ethical thought and action.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1022',4,32,48,2,2,637,'Presocratics and Plato','This course is a study of ancient Greek philosophy from its beginnings to Plato.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1023',4,32,48,2,2,638,'Aristotle and Hellenistic Philosophy','This course is an introduction to Aristotle and the main lines of thought in Hellenistic philosophy, including Stoicism, Epicureanism and Scepticism.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1024',4,32,48,2,2,639,'Introduction to Epistemology','An introduction to the basic concepts and problems in epistemology, including belief, knowledge, scepticism, perception, and intentionality.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1025',4,32,48,2,2,640,'Introduction to Metaphysics','This course is an introduction to metaphysics and the attempt to understand a mind‑independent reality. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1026',4,33,49,2,2,640,'Introduction to International Relations','This course introduces the principal theories, concepts, and debates in the contemporary study of international relations. It provides an overview of issues in international security, international political economy and global governance.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1027',4,33,49,2,2,641,'Human Rights: An Overview',' This course introduces students to the historical origins of the concept of human rights; the international regime and the acceptance of several generations of rights such as civil and political rights, economic rights, group rights, and women’s rights; the critiques of universalism and the problems of implementation of human rights.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1028',4,33,49,2,2,642,'Not‑for‑Profit Organizations and the Law','This course introduces students to the legal regimes affecting not‑for‑ profit organizations (NPO). The course covers the legal structures, rules and procedures that govern NPOs, the vast diversity of NPOs, and practical questions such as how to set up an NPO.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1029',4,33,49,2,2,643,'International Organizations','This course offers an overview of international institutions and global governance. It examines major theoretical perspectives on international organizations, and addresses the role of the United Nations system, regional organizations, and non‑governmental organizations in promoting international co‑operation to address collective problems.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_103',4,28,44,2,2,644,'Communication Media: Advanced Topics','Practicum course','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1030',4,33,49,2,2,645,'Public Policy and the Politics of Equality','This course reviews theoretical debates about the role of the state and the individual, collective and individual rights, integration, and the role of cultural diversity and identity. It examines selected policy demands of women, the poor, refugees, and other constituencies.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1031',4,33,49,2,2,645,'Approaches to Social Science Inquiry','This course introduces students to a variety of approaches to social scientific inquiry, focusing on their underlying logics. The course covers variable‑based research of the qualitative and quantitative variety and alternatives to this approach such as critical theory, process‑tracing, modelling, ethnography, interpretivist analysis, and conceptual analysis.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1032',4,1,1,1,1,645,'Arts and Science Federation of Associations','Largest faculty association, representing over 16,000 undergraduate Arts and Science students.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1033',4,34,1,1,1,645,'School of Community and Public Affairs Students’ Association','The SCPASA provides advocacy for students of the School of Community and Public Affairs','https://scpasa.ca');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1034',4,35,50,1,1,645,'Liberal Arts Society ','LAS represents students who are majoring and minoring in the Western Society and Culture program of the Liberal Arts College of Concordia','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1035',4,36,1,3,8,645,'Chemistry and Biochemistry Graduate Students Association','Graduate student association for MSc and PhD students in the Department of Chemistry and Biochemistry','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1036',4,31,1,3,8,645,'Student Association for Graduates in English (SAGE)','SAGE"s purpose is to enrich the academic, creative, and social life of all MA and Ph.D. students enrolled in the English graduate program.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1037',4,1,1,3,8,645,'IPSA-Concordia Summer School in Applied Diplomacy','Policy-oriented seminars will be complemented with a practical hands-on Diplomacy Lab, allowing the participants to work on case studies in teams. ','https://www.concordia.ca/summer/artsci/ipsa-applied-diplomacy.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1038',4,1,1,3,8,645,'Projected Futures 5: Experimental Science Journalism Studies','Projected Futures 5 is an intensive and experiential summer school that will challenge participants to rethink how science is communicated with society. Graduate students will be exposed to the foundations of evidence-based science journalism and then asked to experiment to create new forms of scientific storytelling.','https://www.concordia.ca/artsci/journalism/programs/journalism-studies.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1039',4,1,1,1,1,645,'Azrieli Institute of Israel Studies','A common passion and dedication to the study of Israel brings together faculty, researchers and students from diverse fields such as archaeology, religion, political science, economics, arts and literature, and anthropology and sociology.','https://www.concordia.ca/artsci/research/azrieli-institute.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_104',4,28,44,3,13,646,'Cultures of Production','Field research projects','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1040',4,1,1,3,8,646,'Centre for Interdisciplinary Studies in Society and Culture','The Centre for Interdisciplinary Studies in Society and Culture is Concordia’s home for discussion, exchange, and collaborative research across the humanities and the arts.','https://www.concordia.ca/artsci/cissc.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1041',4,1,1,3,8,646,'Loyola Sustainability Research Centre','The mission of the Loyola Sustainability Research Centre (LSRC) is to promote a transdisciplinary approach to research and education about relationships among natural, human, and technological systems through basic and applied research, research creation, and art and design. ','https://www.concordia.ca/artsci/research/loyola-sustainability.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1042',4,1,1,3,8,646,'Centre for Applied Synthetic Biology (CASB)','Concordia’s Centre for Applied Synthetic Biology is Canada’s first and only research centre dedicated to the development of foundational technologies in synthetic biology and their application to solve emerging needs in environmental protection, sustainable manufacturing, agriculture, food production and drug development. ','https://www.concordia.ca/research/casb.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1043',4,1,1,3,8,646,'The Centre for Biological Applications of Mass Spectrometry','The Centre for Biological Applications of Mass Spectrometry (CBAMS) is a state-of-the-art facility that supports researchers and provides graduate students enrolled in "omics" sciences with valuable hands-on training.','https://www.concordia.ca/research/mass-spec.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1044',4,1,1,3,8,646,'The Centre for Clinical Research in Health','The Centre for Clinical Research in Health (CCRH) is devoted to the study of the psychosocial determinants of physical and mental health.','https://www.concordia.ca/research/clinical-research-health.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1045',4,1,1,3,8,646,'Centre for NanoScience Research','The Centre for NanoScience Research provides access to state-of-the-art instrumentation and fosters and promotes interdisciplinary research collaborations in nanoscale science.','https://www.concordia.ca/research/nanoscience.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1046',4,1,1,1,1,646,'Centre for Oral History and Digital Storytelling','It explores the links between oral history, digital media, the arts and education.','https://storytelling.concordia.ca');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1047',4,1,1,3,8,646,'The Centre for Research in Human Development','The Centre for Research in Human Development (CRDH) brings together top researchers and trainees in the area of lifespan development.','http://crdh.concordia.ca/homee.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1048',4,1,1,1,1,646,'Centre for Research in Molecular Modeling','CERMM is a multi-institutional research centre that supports research in the molecular sciences, fostering collaborations between researchers in all fields of molecular simulations, including chemistry, biology, physics and engineering.','https://www.concordia.ca/research/molecular-modeling.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1049',4,1,1,1,1,646,'Centre for Sensory Studies','The Centre for Sensory Studies is an interdisciplinary collaboration platform for research in the social life and history of the senses, multisensory aesthetics, sensory design and marketing, and the development of technologies for expanding the sensorium in innovative ways.','http://centreforsensorystudies.org');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_105',4,28,44,3,13,647,'Media Production: Sound','Lectures and Laboratory: average 6 hours per week','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1050',4,1,1,1,1,647,'Centre for Structural and Functional Genomics','A state-of-the-art core genomics facility and computational resources to sequence, process and store the genetic information of various organisms.','https://www.concordia.ca/research/genomics.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1051',4,1,1,1,1,647,'The Center for Studies in Behavioral Neurobiology','The Center for Studies in Behavioral Neurobiology (CSBN) brings together the talents of scientists interested in probing the fundamental brain mechanisms that underlie behavior and disease.','https://www.concordia.ca/research/neuroscience.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1052',4,1,1,1,1,647,'The Centre for the Study of Learning and Performance','The mission of the CSLP is to conduct research on teaching and learning processes.','https://www.concordia.ca/research/learning-performance.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1053',4,1,1,1,1,647,'Centre for Broadcasting and Journalism Studies','The Concordia Centre for Broadcasting and Journalism Studies has been involved with the study of media since 1981, as a research centre and as an archive. The Centre prides itself as a hub of intellectual engagement with media by sociologists, journalism and communication scholars, historians, and literature specialists.','https://www.concordia.ca/research/broadcasting-journalism.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1054',4,1,1,3,8,647,'Centre for the Study of Politics and Immigration','The CSPI is a research initiative on the politics of immigration and on immigration-related public policies. It produces and supports original research, provides training to students and is engaged in knowledge dissemination.','https://www.concordia.ca/artsci/research/cspi.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1055',4,1,1,1,1,647,'Technoculture, Art and Games (TAG)','Technoculture, Art and Games (TAG) is an interdisciplinary centre for research/creation in game studies and design, digital culture and interactive art.','https://tag.hexagram.ca');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1056',4,1,1,1,1,647,'Karl Polanyi Institute of Political Economy','The mission of the Institute is two-fold: to preserve the intellectual legacy of Karl Polanyi and to contribute to research and  policy debates on new development strategies locally and internationally and on the new or reformed multilateral institutions required for the global order.','https://www.concordia.ca/research/polanyi.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1057',4,1,1,1,1,647,'Institute for Genocide and Human Rights Studies (MIGS)','The institute serves as a leadership and ideas incubator that convenes stakeholders with the goal of developing better policies to protect human rights. ','https://www.concordia.ca/research/migs.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1058',4,1,1,1,1,647,'Microscopy and Cellular Imaging','The Centre for Microscopy and Cell Imaging provides members of Concordia University with access to advanced fluorescence microscopes.','https://www.concordia.ca/research/microscopy-cellular-imaging.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1059',4,1,1,1,1,647,'Montreal Health Statistics Centre','The Montreal Health Statistics Centre (MHS) connects Statistics students and faculty with health researchers. Through training, networking and collaboration, we promote best practices and methodologies relevant to health research.','https://www.concordia.ca/artsci/research/montreal-health-statistics-centre.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_106',4,28,44,3,13,648,'Media Production: Intermedia','Lectures and Laboratory: average 6 hours per week','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1060',4,1,1,1,1,648,'Institute for Investigative Journalism','The Institute for Investigative Journalism (IIJ) offers unparalleled educational experiences for journalism students and in-depth coverage of complex stories in underserved communities. IIJ connects major media outlets with journalism students and faculty from across the nation to carry out investigations in the public interest.','https://www.concordia.ca/artsci/journalism/research/investigative-journalism.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1061',4,1,1,3,8,648,'Social Justice Centre','The Social Justice Centre provides support for events, offers fellowships for postdoctoral researchers and graduate students and promotes dialogue and collaboration between researchers with different backgrounds and methodologies.','https://www.concordia.ca/artsci/research/social-justice-centre.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1062',4,1,1,3,8,648,'Center for Research on Values, Attitudes and Societies','The Center for Research on Values, Attitudes and Societies aims to study the evolution of values and attitudes among societies, in Canada and throughout the world.','https://www.concordia.ca/artsci/research/cevas-en.html');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_1063',4,1,1,1,1,648,'Concordia Centre for Cognitive Science and Linguistics','The Concordia Centre for Cognitive Science and Linguistics provides a structure for the intellectual exchange and sharing of resources among scholars at Concordia University and other institutions who are interested in the study of the mind. ','https://www.concordia.ca/artsci/research/cognitive-science-linguistics.html');
