INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_990',4,30,147,2,2,1209,'Introduction to Theories of Sexuality','This course is a multidisciplinary introduction to the central problems in the study of sexuality. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_991',4,30,147,2,2,1210,'Introduction to Sexuality Research','This course surveys interdisciplinary approaches to research in sexuality within the humanities, arts and social sciences. The course considers different research methodologies in sexuality research, with opportunities to apply multiple methods.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_992',4,30,147,2,2,1211,'Ethics and Community Engagement','This course examines the ethics, practices, and processes of working within and alongside of communities. Examining both theoretical and practical texts, case studies, and site-visits in the area of feminism and sexuality, the course prepares students to enter into the Practicum experience.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_993',4,30,147,2,2,1212,'Practicum','This course offers a 100-hour field experience over the course of one semester. The course involves a fieldwork project.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_994',4,29,45,2,2,1213,'Introduction to History','The course offers an introduction to historical argumentation, research skills, and the interpretation of primary and secondary sources. The course will build skills in persuasive writing, library research, critical reading of documents, and the analysis of historical problems.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_995',4,29,45,2,2,1214,'Film in History','This course examines how selected commercial films interpret historical events or provide insight into the politics, society, and culture of the times in which they were produced. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_996',4,29,45,2,2,1215,'History and the Public','This course is an examination of the practice of history outside the academy and an introduction to the critical analysis of presentations of history in public and popular culture. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_997',4,29,45,2,2,1216,'History of Montreal','A study of the origins of the city, its role in the Empire of the St. Lawrence, and its rise to metropolitan dominance in Canada.','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_998',4,29,45,2,2,1217,'Music in History','This course examines music as a medium for understanding the past. Depending on the historical focus, issues such as colonialism, nationalism, social movements, urban culture, youth culture, race, gender, and class through the prism of contemporaneous music genres may be considered. ','');
INSERT IGNORE INTO courses (school_key, facultyID, departmentID, programID, courseLevelID, degreeID, subjectID, courseTitle, description, website) values ('FAS_999',4,29,45,2,2,1218,'History and the Graphic Novel','This course explores the ways comics and graphic novels express and interpret history.','');
